import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import './ScriptList.css';

function ScriptList({ onScriptSelect, scriptList, activeIndex }) {
    return (
        <div>
            <ListGroup
                className='script-list'
                defaultActiveKey='#link0'
                onClick={onScriptSelect}
                activeKey={`#link${activeIndex}`}
            >
                {scriptList.map((item, i) => {
                    return (
                        <ListGroup.Item action href={`#link${i}`} key={i}>
                            {item.name}
                        </ListGroup.Item>
                    );
                })}
            </ListGroup>
        </div>
    );
}

export default ScriptList;
